import React from 'react'
import { Button, List } from 'antd';
import { UserOutlined } from '@ant-design/icons';



const BookingCardAntd = (props) => {
    const listData = props.myBooking;

    return (
        <List
            itemLayout="vertical"
            size='default'
            style={{
                width:'100%',
            }}
            dataSource={listData}
            renderItem={item => (
                <List.Item
                    style={{
                        width:'100%',
                        height:'180px',
                        padding:'10px 0px 0px 0px', 
                        marginBottom:'10px',
                        borderRadius:'10px',
                        backgroundColor:'white'
                    }}
                    key={item.title}
                >
                    <List.Item.Meta
                        style={{backgroundColor:'#5C082A', marginBottom:'0px'}}
                        title={
                            <div style={{backgroundColor:'white', width:'100%'}}>
                                <h2>{item.date}<UserOutlined/></h2>
                            </div>}
                        description={
                            <div style={{display:'flex', flexWrap:'wrap'}}>
                                <div style={{width:'50%', display:'flex', justifyContent:'center', alignContent:'center', height:'100%'}}>
                                    <h3 style={{fontSize:'30px',textAlign:'right', fontFamily:'Montserrat', color:'white'}}>{item.restaurant}</h3>
                                </div>
                                <div style={{width:'50%',height:'100%'}}>
                                  <span style={{fontSize:'13px',textAlign:'right', fontFamily:'Montserrat', color:'white', width:'100%', wordBreak:'break-all'}}>{item.description}</span>
                                </div>
                            </div>
                        }
                    />
                    <Button style={{width:'50%', border:'2px solid white'}}>ACCEPT</Button>
                    <Button style={{width:'50%', border:'2px solid white'}}>DECLINE</Button>
                </List.Item>
            )}
        />
    )
}

export default BookingCardAntd
